import React, { useContext } from "react";

import { sakContext, userContext } from "./App";

const ComponentC = () => {
  const user = useContext(userContext);
  const sak = useContext(sakContext);
  return (
    <div>
      this is me {sak} and {user}
    </div>
  );
};

export default ComponentC;
